codegen: Zero length of arrays when transferring ownership

This allows var data = (owned) aGenericArray.data;
without later setting data.len = 0 manually.

Term tagger now partially working. Currently works on the whole investigation although does no String substitution yet to replace the freetext with ontology terms.
Next week will add functionality to:
1) visualise the freetext which was annotated;
2) add term tagging on a per spreadsheet basis;
3) add term tagging on a per study basis;
4) when you right click on a term or a selection of terms which are in a column requiring ontologies, you can click 'tag with ontology' and it will start tagging the terms and display the results
